import{_ as i,c as l,o as a,a2 as e}from"./chunks/framework.C94oF1kp.js";const x=JSON.parse('{"title":"FlexFish 的兼容性","description":"","frontmatter":{},"headers":[],"relativePath":"guide/compatibility.md","filePath":"guide/compatibility.md"}'),o={name:"guide/compatibility.md"},t=e('<h1 id="flexfish-的兼容性" tabindex="-1">FlexFish 的兼容性 <a class="header-anchor" href="#flexfish-的兼容性" aria-label="Permalink to &quot;FlexFish 的兼容性&quot;">​</a></h1><p>由于功能太多，虽然尽力去做兼容性的适配，但是绝无可能做到非常广泛的兼容性，特此说明上线以来观察到的兼容性情况，大部分情况重启能解决99%的使用上的问题</p><h2 id="windows" tabindex="-1">Windows <a class="header-anchor" href="#windows" aria-label="Permalink to &quot;Windows&quot;">​</a></h2><ul><li>所有 32 位 Windows 系统均不兼容，也不会兼容</li><li>arm 设备 未作测试，兼容性未知</li><li>最低操作系统要求 Windows 7 x64 专业版/旗舰版 及以上</li><li>超级精简版系统大概率无法使用，或部分功能受限</li><li>系统环境被篡改过多有概率无法使用，或部分功能受限</li><li>存在毒瘤安全、杀毒、病毒软件大概率导致部分功能受限，强烈建议毒瘤软件防护等级开启严格模式</li><li>PPPOE 拨号用户需要将PPPOE拨号名改为纯英文，或开启进阶模式(TUN)</li><li>安装了 Radmin VPN、或其他依赖于虚拟网卡的VPN，并且正在运行的设备会导致内核出口网卡选择错误，导致无法使用，请引导用户卸载</li><li>客户端安装路径存在权限问题会导致客户端无法打开，需要更改安装路径或使用默认安装路径，确保自定义的安装路径下没有其他软件安装，推荐在盘符根目录下新建一个纯英文的新文件夹安装</li><li>系统代理无法被修改或被劫持，会导致普通代理模式无法使用，可以开启进阶模式(TUN)</li><li>同时开启同类软件、加速器等导致的冲突问题，无法正常使用，请引导用户关闭所有同类软件、加速器等</li><li>特殊网络环境导致分流异常、DNS解析错误</li></ul><h2 id="macos" tabindex="-1">macOS <a class="header-anchor" href="#macos" aria-label="Permalink to &quot;macOS&quot;">​</a></h2><ul><li>所有 32 位 macOS 系统均不兼容，也不会兼容</li><li>系统版本号低于 macOS 10.12.x(Sierra) 无法使用，也不会兼容</li><li>arm 设备需要安装 Rosetta2 转义运行</li><li>同时开启同类软件、加速器等导致的冲突问题，无法正常使用，请引导用户关闭所有同类软件、加速器等</li><li>特殊网络环境导致分流异常、DNS解析错误</li><li>系统密码填写错误，或者过于邪门导致内核无法正常启动</li><li>系统代理无法被修改或被劫持，会导致普通代理模式无法使用，可以尝试重置网络或开启进阶模式(TUN)</li></ul><h2 id="linux-gui" tabindex="-1">Linux GUI <a class="header-anchor" href="#linux-gui" aria-label="Permalink to &quot;Linux GUI&quot;">​</a></h2><ul><li>arm 设备不兼容</li><li>所有 32 位 Linux 系统均不兼容，也不会兼容</li><li>系统版本低于或等于 CentOS 7 或同时期其他发行版大概率无法使用，或部分功能受限</li><li>Steam OS 或其他魔改 Linux GUI 无法安装 Appimagelauncher，可以直接打开 .appimage 的安装包使用</li><li>没有 GUI 纯命令行无法使用</li><li>部分发行版自带的 Firfox浏览器 不遵守系统代理设置，需要开启进阶模式 TUN 或安装 Google Chrome</li><li>系统分支过多，安装门槛较高，故还有很多未知数，但 Dashboard 中列出的分支基本没问题</li></ul><h2 id="android" tabindex="-1">Android <a class="header-anchor" href="#android" aria-label="Permalink to &quot;Android&quot;">​</a></h2><ul><li>所有 32 位 Android 系统均不兼容，也不会兼容</li><li>鸿蒙Next 不兼容</li><li>鸿蒙OS等所有遇到一段时间就断网情况的国产OS，需要对客户端关闭省电优化，后台限制</li><li>可能会被腾讯加入伪病毒库，导致所有在大陆正规渠道销售的设备提示高风险病毒，无法使用，只能重新打包分发</li><li>系统版本低于 Android 7.0 大概率无法使用，或部分功能受限</li><li>屏幕尺寸过大、过小导致布局错误</li></ul><h2 id="ios-ipados" tabindex="-1">iOS/iPadOS <a class="header-anchor" href="#ios-ipados" aria-label="Permalink to &quot;iOS/iPadOS&quot;">​</a></h2><ul><li>部分系统版本存在少量闪退，修复中</li><li>系统版本低于 iOS15.0 或 iPadOS 15.0 由于内存限制的缘故无法使用</li><li>超大连接数导致内存瞬时超过 50MB 限制被系统杀掉 Packect Tunnel 进程，需要重新连接</li><li>屏幕尺寸过大、过小导致布局错误</li></ul>',12),r=[t];function d(n,s,c,h,u,m){return a(),l("div",null,r)}const p=i(o,[["render",d]]);export{x as __pageData,p as default};
